import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const Akun = () => {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Home Screen</Text>
    </View>
    )
}

export default Akun

const styles = StyleSheet.create({})
